// @run-at       document-end
// @downloadURL https://update.greasyfork.org/scripts/481473/TBD%3A%20Seedbonus%20Tycoon%20for%20TorrentBD.user.js
// @updateURL https://update.greasyfork.org/scripts/481473/TBD%3A%20Seedbonus%20Tycoon%20for%20TorrentBD.meta.js
// ==/UserScript==

// Custom JS to enable seedbonus donation
const seedJS = `
function superSB() {
	$.ajax({
		url: siteUrl + "ajgiftsb.php",
        type: "POST",
        data: {
			t: window.tycoonid,
            a: window.tycoonamount
        },
        success: ""
    });
    Materialize.toast(window.tycoonmessage, 2000);
}
`;

// Add JS to DOM
function addSeedJStoDOM() {
    let newJS = document.createElement('script');
    newJS.setAttribute('type', 'text/javascript');
    newJS.innerHTML = seedJS;

    document.body.appendChild(newJS);
}

// Retrieve variable value from link
function getVar(linked) {
    let vars = {};
    linked.replace(/[?&]+([^=&]+)=([^&]*)/gi, function(m,key,value) {
        vars[key] = value;
    });
    return vars;
}

// Utilizing custom JS from user script
function sendSB(tno, amnt, mesg) {
    window.tycoonid = tno;
    window.tycoonamount = amnt;
    window.tycoonmessage = mesg;

    let myJS = encodeURIComponent('superSB()');

    location.assign('javascript:' + myJS);
}

// Add a button for donating
function addAccountDetailsButton() {
    let btnParent = document.querySelector('.pr-action-container'),
        btnElmnt = document.createElement('a');
    btnElmnt.setAttribute('class','btn-floating btn waves-effect waves-light seed-tycoon');
    btnElmnt.setAttribute('title','Make user happy');
    btnElmnt.innerHTML = '<i class="material-icons small">monetization_on</i>';

    btnParent.appendChild(btnElmnt);

    let btnClicky = document.querySelector('.seed-tycoon');

    btnClicky.addEventListener('click', sendVisible);
}

// Donate to all visible torrents
function sendVisible() {
    let visTorrents = document.querySelectorAll('#torrents-main a[href*="torrents-details.php"][href*="hit"]');

    for (let x = 0; x < visTorrents.length; x++) {
        let xid = parseInt(getVar(visTorrents[x].href).id);
        setTimeout(function() {
            sendSB(xid, 1000, `Donation no. ${x+1} done!`);
        }, 100*x);
    }
}

// Only operate in the account details page
if (window.location.pathname.match(/account\-details\.php/)) {
    addSeedJStoDOM();
    addAccountDetailsButton();
}